WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Привіт!

WordPress має вбудовану функцію що визначає коли плагін або тема спричиняє фатальну помилку на вашому сайті та сповіщає вас цим автоматичним повідомленням.
###CAUSE###
Спочатку відвідайте свій сайт (###SITEURL###) і перевірте чи є якісь видимі проблеми. Далі, зайдіть на сторінку, на якій виникла помилка (###PAGEURL###) та перевірте чи є на ній якісь видимі проблеми.

###SUPPORT###

Якщо ваш сайт виглядає зламаним і ви не можете нормально увійти в Майстерню, WordPress тепер має спеціальний "режим відновлення". Це дозволяє вам безпечно увійти у вашу Майстерню для подальших дій.

###LINK###

Для безпеки вашого сайту, термін дії цього посилання закінчується через ###EXPIRES###. Але не турбуйтеся, вам буде надіслано нове посилання якщо помилка виникне знову після закінчення терміну дії цього посилання.

Для отримання допомоги у вирішенні цієї проблеми вам може бути потрібна наступна інформація:

###DEBUG###

