r. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.','Name for the Visual editor tabVisual'=>'Візуально','Create New Menu'=>'Створити нове меню','New Menu'=>'Нове меню','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Меридіан','Minute'=>'Хвилина','Hour'=>'Година','Time'=>'Час','Day'=>'День','Month'=>'Місяць','Date'=>'Дата','Usage of user levels is deprecated. Use capabilities instead.'=>'Використання рівнів для користувачів застаріло. Використовуйте можливості.','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Якщо використовувана тема має області віджетів, то ви можете також додати туди меню. Зайдіть на <a href="%s">панель управління віджетами</a> і додайте &#8220;Віджет меню навігації&#8221;, щоб відображати меню на бічній панелі або в підвалі.','The theme defines itself as its parent theme. Please check the %s header.'=>'Тема визначає себе як батьківську для себе ж. Будь ласка, перевірте заголовок %s.','Add your own CSS code here to customize the appearance and layout of your site.'=>'Тут можна додати свій власний код CSS щоби змінити вигляд сайту.','Your homepage displays'=>'Ваша домашня сторінка відображає','Your theme can display menus in one location.'=>'Ваша тема може відображати меню в одному розміщенні.','Your theme can display menus in %s location.'=>'Ваша тема може відображати меню в %s розміщенні.' . "\0" . 'Ваша тема може відображати меню в %s розміщеннях.' . "\0" . 'Ваша тема може відображати меню в %s розміщеннях.','When using a keyboard to navigate:'=>'Коли використовується клавіатура для навігації:','In the editing area, the Tab key enters a tab character.'=>'В області редагування, клавіша Tab вводить символ табуляції.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'Для користувачів читача екрану: в режимі форм вам може бути потрібно натиснути клавішу Esc двічі.','To move away from this area, press the Esc key followed by the Tab key.'=>'Щоби вийти з цієї області, натисніть клавішу Esc, потім клавішу Tab.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Якщо ваша тема має декілька меню, то чіткі назви допоможуть вам керувати ними.','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Поле редагування автоматично виділяє синтаксис коду. Ви можете вимкнути це у вашому <a href="%1$s" %2$s>обліковому записі%3$s</a> щоби працювати в режимі простого тексту.','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Ви можете вибрати те, що відображається на головній сторінці вашого сайту. Це можуть бути записи в зворотному хронологічному порядку (класичний блог) або постійна/статична сторінка. Щоб встановити статичну головну сторінку, вам потрібно створити дві сторінки. Одна стане головною сторінкою, на другій будуть відображатися ваші записи.','CSS code'=>'Код CSS','Homepage Settings'=>'Налаштування домашньої сторінки','WordPress.org themes'=>'Теми WordPress.org','Installed themes'=>'Встановлені теми','Copied'=>'Скопійовано','Changes trashed successfully.'=>'Зміни переміщені до кошика успішно.','Changes have already been trashed.'=>'Зміни були вже видалені в корзину.','Unable to trash changes.'=>'Неможливо видалити зміни в кошик.','No changes saved yet, so there is nothing to trash.'=>'Ніяких змін не було збережено, тому нічого видаляти.','Unable to save due to %s invalid setting.'=>'Неможливо зберегти через %s невірне налаштування.' . "\0" . 'Неможливо зберегти через %s невірних налаштування.' . "\0" . 'Неможливо зберегти через %s невірних налаштувань.','You must supply a future date to schedule.'=>'Ви повинні вказати дату в майбутньому для планування.','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Подивіться як зміни будуть наживо виглядати на вашому сайті і поділіться попереднім переглядом з тими, у кого немає доступу до налаштувань.','Share Preview Link'=>'Поділитися посиланням на попередній перегляд','Preview Link'=>'Посилання на попередній перегляд','Publish Settings'=>'Налаштування публікування','There was an authentication problem. Please reload and try again.'=>'Виникла проблема з авторизацією. Будь ласка, перезавантажте і спробуйте знову.','View User'=>'Переглянути користувача','Edit User'=>'Редагувати користувача','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Попередній набір змін уже був опублікований. Будь ласка, спробуйте знову зберегти ваш поточний набір змін.','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Цей віджет міг містити код, який може краще працювати у віджеті &#8220;Власний HTML&#8221;. Якщо ви ще не пробували, як щодо того, щоби натомість спробувати його?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Code&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Code&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'А ви знали що вже є віджет &#8220;Власний HTML&#8221;? Ви можете знайти його в списку доступних віджетів у цьому розділі. Спробуйте його щоби додати власний код на свій сайт!','Did you just paste HTML?'=>'Ви щойно вставили HTML?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and searching for &#8220;HTML&#8221;. Check it out to add some custom code to your site!'=>'А ви знали що вже є віджет &#8220;Власний HTML&#8221;? Ви можете знайти його натиснувши кнопку &#8220;<a class="add-widget" href="#">Додати віджет</a>&#8221; і пошукавши &#8220;HTML&#8221;. Спробуйте його щоби додати власний код на свій сайт!','New Custom HTML Widget'=>'Новий віджет власного HTML','This widget may contain code that may work better in the &#8220;Custom HTML&#8221; widget. How about trying that widget instead?'=>'Цей віджет може містити код, який може краще працювати у віджеті &#8220;Власний HTML&#8221;. Як на рахунок того, щоби натомість спробувати той віджет?','Arbitrary text.'=>'Довільний текст.','Arbitrary HTML code.'=>'Довільний код HTML.','Some HTML tags are not permitted, including:'=>'Деякі теги HTML не дозволено:','Custom HTML'=>'HTML код','%s item'=>'%s елемент' . "\0" . '%s елементи' . "\0" . '%s елементів','Show tag counts'=>'Показувати лічильники позначок','label for button in the media widgetAdd Media'=>'Додати медіафайл','label for button in the video widgetAdd Video'=>'Додати відео','label for button in the image widgetAdd Image'=>'Додати зображення','label for button in the audio widgetAdd Audio'=>'Додати аудіозапис','(no author)'=>'(без автора)','An error occurred. Please try again later.'=>'Виникла помилка. Будь ласка, спробуйте знову.','The network currently allows user registrations.'=>'Реєстрація користувачів в мережі дозволена.','The network currently allows both site and user registrations.'=>'Реєстрація сайтів і користувачів в мережі дозволена.','To change or disable registration go to your <a href="%s">Options page</a>.'=>'Для зміни налаштувань або відключення реєстрації пройдіть на <a href="%s">Сторінку налаштувань</a>.','The network currently allows site registrations.'=>'Реєстрація сайтів в мережі дозволена.','The network currently disallows registrations.'=>'Реєстрація сайтів і користувачів в мережі заборонена.','Greetings Network Administrator!'=>'Вітаємо Адміністратора Мережі!','Title for the widget'=>'Назва віджета','URL to the media file'=>'URL медіафайлу','Add to Widget'=>'Додати до віджету','No media selected'=>'Медіа не вибрано','A media item.'=>'Медіа елемент.','URL to the %s video source file'=>'URL для джерела %s відео','Attachment post ID'=>'ID запису вкладення','Media Widget'=>'Медіа','Media Widget (%d)'=>'Медіа віджет (%d)' . "\0" . 'Медіа віджети (%d)' . "\0" . 'Медіа віджети (%d)','label for button in the media widget; should preferably not be longer than ~13 characters longEdit Media'=>'Редагувати','label for button in the media widget; should preferably not be longer than ~13 characters longReplace Media'=>'Замінити','Video Widget'=>'Відео','Video Widget (%d)'=>'Відео віджет (%d)' . "\0" . 'Відео віджети (%d)' . "\0" . 'Відео віджети (%d)','Looks like this is not the correct kind of file. Please link to an appropriate file instead.'=>'Схоже, це невірний тип файлу. Потрібне посилання на файл відповідного типу.','No audio selected'=>'Аудіофайл не вибрано','label for button in the video widget; should preferably not be longer than ~13 characters longEdit Video'=>'Редагувати','label for button in the video widget; should preferably not be longer than ~13 characters longReplace Video'=>'Замінити','Image Widget'=>'Зображення','Image Widget (%d)'=>'Віджет зображень (%d)' . "\0" . 'Віджети зображень (%d)' . "\0" . 'Віджети зображень (%d)','label for button in the image widget; should preferably not be longer than ~13 characters longEdit Image'=>'Редагувати','label for button in the image widget; should preferably not be longer than ~13 characters longReplace Image'=>'Замінити','Displays an image.'=>'Показує зображення.','Unable to preview media due to an unknown error.'=>'Попередній перегляд медіа неможливий через невідому помилку.','URL to the %s audio source file'=>'URL джерела %s аудіофайлу.','Audio Widget'=>'Аудіо','Audio Widget (%d)'=>'Аудіо віджет (%d)' . "\0" . 'Аудіо віджети (%d)' . "\0" . 'Аудіо віджети (%d)','label for button in the audio widget; should preferably not be longer than ~13 characters longEdit Audio'=>'Редагувати','label for button in the audio widget; should preferably not be longer than ~13 characters longReplace Audio'=>'Замінити','Displays an audio player.'=>'Відображає аудіо програвач.','label for button in the gallery widget; should not be longer than ~13 characters longEdit Gallery'=>'Редагувати','label for button in the gallery widget; should not be longer than ~13 characters longAdd Images'=>'Додати','Displays a video from the media library or from YouTube, Vimeo, or another provider.'=>'Показує відео з бібліотеки медіа або з YouTube, Vimeo, чи іншого провайдера.','Looks like this is not the correct kind of file. Please link to an audio file instead.'=>'Схоже, це невірний тип файлу. Потрібне посилання на аудіофайл.','All features, supported by the post type.'=>'Всі можливості підтримувані типом запису.','%1$s must be less than or equal to %2$d'=>'%1$s має бути менше або дорівнювати %2$d','%1$s must be less than %2$d'=>'%1$s має бути менше, ніж %2$d','%1$s must be greater than or equal to %2$d'=>'%1$s має бути більше або дорівнювати %2$d','%1$s must be greater than %2$d'=>'%1$s має бути більше, ніж %2$d','The page number requested is larger than the number of pages available.'=>'Номер запитаної сторінки перевищує кількість наявних сторінок.','You need to define an include parameter to order by include.'=>'Потрібно визначити параметр включення в порядок включення.','Limit result set to users with one or more specific slugs.'=>'Обмежити вибірку користувачами з певними слаґами (одним або більше).','Limit result set to terms with one or more specific slugs.'=>'Обмежити вибірку групами з певними слаґами (одним або більше).','The password for the parent post of the comment (if the post is password protected).'=>'Пароль для батьківського запису коментаря (якщо запис захищено паролем).','%1$s is deprecated. The callback from %2$s is used instead.'=>'%1$s застаріло. Замість цього використовуйте зворотний виклик %2$s.','pageFeatured image'=>'Головне зображення','postFeatured image'=>'Головне зображення','postSet featured image'=>'Встановити головне зображення','pageSet featured image'=>'Встановити головне зображення','postRemove featured image'=>'Видалити головне зображення','pageRemove featured image'=>'Видалити головне зображення','postUse as featured image'=>'Використовувати як головне зображення','pageUse as featured image'=>'Використовувати як головне зображення','You are about to permanently delete these items from your site.
